import React from 'react';
import Home from './Home';
import { Switch, Route } from 'react-router-dom';

//import './App.css';

const App = () => {
  return (
    <div>
      <Switch>
        <Route path="/" component={Home}/>
        <Route path="/about" component={About}/>
        <Route path="/service" component={Home}/>
        <Route path="/" component={Home}/>
      </Switch>
    </div>
  );
}

export default App;
